import { useRouter } from "next/router";
import { SimpleGrid, Text } from "@chakra-ui/core";
import useSWR from "swr";

const UserData = () => {
  const router = useRouter();
  const { id } = router.query;
  const { data, error } = useSWR(`/api/user/${id}`);

  return (
    <SimpleGrid columns={2} width="2xs" spacingY={4}>
      <Text fontWeight="blod" marginRight={4}>
        UserID
      </Text>
      <Text>{`data.id`}</Text>

      <Text fontWeight="blod" marginRight={4}>
        Name
      </Text>
      <Text>{`data.name`}</Text>

      <Text fontWeight="blod" marginRight={4}>
        Email
      </Text>
      <Text>{`data.email`}</Text>
    </SimpleGrid>
  );
};

const user = () => {
  const router = useRouter();
  const { id, ...rest } = router.query;
};

export default user;
